import axios from 'axios';
import React, { useEffect, useState } from 'react'
// import { useParams } from 'react-router-dom'
import { useNavigate, useParams } from 'react-router-dom'
import Menu from '../Menu';
import Footer from '../Footer';

export default function Edit_type() {
    const navigate = useNavigate();
    const d = useParams();
    const [title, settitle] = useState("");
    const [msg, setmsg] = useState("");
    useEffect(()=>{
        axios.post('http://localhost/fleet_manage/backend/Rubel/editvehicle_type', {
            id: d.id,
          },{
            headers: {
              'Content-Type': 'application/json',
              'Authorization':localStorage.getItem('token')
            },
        }
        )
        .then(function(response){
            let data=response.data;
            console.log(data)
             settitle(data.user.title);
            
        })
    },[]);
    const update=()=> {
      axios.post('http://localhost/fleet_manage/backend/Rubel/updatevehicle_type', {
          title: title,
          id: d.id
    },{
      headers: {
        'Content-Type': 'application/json',
        'Authorization':localStorage.getItem('token')
      }
    }).then(function (response) {
      let data=response.data;
      setmsg(data.msg)
      setTimeout(()=>navigate('/typelist'), 5000)
      
       
              
    })
  }
  return (
    
    <>
        <div className="hold-transition sidebar-mini">
        <div className="wrapper">
          <Menu/>
          <div className="content-wrapper">
            <div className="content-header">
              <div className="container-fluid">
                <div className="row mb-2">
                  <div className="col-sm-6">
                    <h1 className="m-0">Edit vehicle </h1>
                  </div>
                  <div className="col-sm-6">
                    <ol className="breadcrumb float-sm-right">
                      <li className="breadcrumb-item"></li>
                      <li className="breadcrumb-item active">Edit vehicle Type</li>
                    </ol>
                  </div>
                  <h3>{msg}</h3>
                </div>
              </div>
            </div>

            <div className="content">
              <div className="container-fluid">
                <div className="row">
                  <div className="col-lg-12">
                    <div className="card card-primary card-outline">
                      <div className="card-header">
                        <h5 className="m-0">Edit Vehicles</h5>
                      </div>
                      <div className="card-body">
                        <table className="table table-bordered">
                          <tbody>
                            <tr>
                              <th>Title</th>
                              <td>
                                <input
                                  type="text"
                                  className="form-control"
                                  onChange={(e) =>
                                    settitle(e.target.value)
                                  }
                                  value={title}
                                />
                              </td>
                            </tr>
                            
                            <tr>
                              <td colSpan={2}>
                                <input
                                  type="submit"
                                  className="btn btn-block btn-primary"
                                  value="Update"
                                  onClick={update}
                                />
                              </td>
                            </tr>
                     
                          </tbody>
                        </table>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
          <Footer/>
        </div>
      </div>
    </>
  );
}
